`,paraId:8,tocIndex:5},{value:"Then add the code below into your ",paraId:9,tocIndex:5},{value:"Vite",paraId:9,tocIndex:5},{value:" or ",paraId:9,tocIndex:5},{value:"Webpack",paraId:9,tocIndex:5},{value:" config file.",paraId:9,tocIndex:5},{value:`// vite.config.ts
